import React from 'react'
import $ from 'jquery'

const FileName = () => {
  $(function(){
    // bind change event to select
    $('#dynamic_select').on('change', function () {
        var url = $(this).val(); // get selected value
        if (url) { // require a URL
            window.location = url; // redirect
        }
        return false;
    });
  });
  return (
    <div>
      <select id="dynamic_select">
       <option value="https://hosters.pk/clientarea/index.php/store/ssd-shared-hosting">1 Month - Rs 800.00</option>
      <option value="https://hosters.pk/clientarea/index.php/store/flash-reseller" target="_top">3 Months - Rs 2160.00 Save 10%</option>
      <option value="https://hosters.pk/clientarea/index.php/store/ssd-reseller" target="_top">6 Months - Rs 3840.20 Save 20%</option>
      <option value="https://hosters.pk/clientarea/index.php/store/hdd-shared-hosting/basic-plan?billingcycle=annually" target="_top">1 Year - Rs 5760.00 Save 40%</option>
      </select>
      <select className="btn bg-light text-dark bg-light text-dark w-100 p-2 text-light"  id="dynamic_select">
                  <option className="text-dark rounded" >1 Month - Rs 800.00</option>
                  <option className="text-dark rounded" >3 Months - Rs 2160.00 Save 10%</option>
                  <option className="text-dark rounded" >6 Months - Rs 3840.20 Save 20%</option>
                        <option className="text-dark rounded" >1 Year - Rs 5760.00 Save 40%</option>
                        <option className="text-dark rounded" >2 Years - Rs 10560.00 Save 45%</option>
                        <option className="text-dark rounded" >3 Years - Rs 14400.00 Save 50%</option>
                </select>
    </div>
  )
}

export default FileName
